int* matmul(int m[3][3], int* v) {
    int* newv = (int*)malloc(3 * sizeof(int));
    for (int i = 0;i < 3;i++) {
        newv[i] = m[i][0] * v[0] + m[i][1] * v[1] + m[i][2] * v[2];
    }
    return newv;
}

int* newdir(int n, int* old) {
    int a[3][3] = {
        {0,0,1},
        {0,1,0},
        {-1,0,0}
    };
    int b[3][3] = {
        {0,0,-1},
        {0,1,0},
        {1,0,0}
    };
    int c[3][3] = {
        {0,-1,0},
        {1,0,0},
        {0,0,1}
    };
    int d[3][3] = {
        {0,1,0},
        {-1,0,0},
        {0,0,1}
    };
    if (n == 0) {
        return matmul(c, old);
    }
    if (n == 1) {
        return matmul(d, old);
    }
    if (n == 2) {
        return matmul(b, old);
    }
    else {
        return matmul(a, old);
    }
}
