string clean(string word){
    transform(word.begin(), word.end(), word.begin(), ::tolower);
    while(ispunct(word[word.length()-1])!=0 ){
        word.erase(word.length()-1);
    }
    while(ispunct(word[0] )!=0){
        word.erase(0,1);
    }
    return word;
}

