int main() {
    int n,temp;
    cin >> n;

    int arr[n];

    for (int i = 0 ; i < n; i++){
        cin >> temp;
        arr[i] = temp;
    }

    int maximum = *max_element(arr, arr+n);
    int minimum = *min_element(arr, arr+n);
    int x  = maximum-minimum+1;

    int c[x];
    int result[n];

    for (int i = 0; i < n; i++){
        c[arr[i]-minimum]++;
    }
    for (int i = 1; i < x; i++){
        c[i] += c[i-1];
    }
    for (int i = n-1; i>=0; i-- ){
        result[c[arr[i] - minimum] -1] = arr[i];
        c[arr[i] - minimum]--;
    }


    for (int i = 0 ; i < n; i++){
        if (i!=n-1)
            cout << result[i] << " ";
        else
            cout << result[i];
    }
    cout << "\n";
    return 0;
}

void countSort(vector<int>& arr)
{
    int max = *max_element(arr.begin(), arr.end());
    int min = *min_element(arr.begin(), arr.end());
    int range = max - min + 1;

    vector<int> count(range), output(arr.size());
    for (int i = 0; i < arr.size(); i++)
        count[arr[i] - min]++;

    for (int i = 1; i < count.size(); i++)
        count[i] += count[i - 1];

    for (int i = arr.size() - 1; i >= 0; i--) {
        output[count[arr[i] - min] - 1] = arr[i];
        count[arr[i] - min]--;
    }

    for (int i = 0; i < arr.size(); i++)
        arr[i] = output[i];
}

