struct Reminder {
    int id;
    int interval;
};

bool compareStart(Reminder r1, Reminder r2) {
    if (r1.interval < r2.interval)
        return true;
    else if (r1.interval == r2.interval) {
        return (r1.id < r2.id);
        //            return true;
    }
    return false;
}
